resources.string:
Compruebe que:

• el encendido esté en contacto;
• el vehículo esté en P (Estacionamiento);
• los frenos no se estén aplicando;
• las luces de emergencia y las luces de giro estén apagadas.

Por medio de esta acción:
• se vuelven a habilitar las aplicaciones o notificaciones que haya deshabilitado;
• se restablecen sus preferencias de las aplicaciones a los valores predeterminados;
• se eliminan los permisos que le haya otorgado a las aplicaciones;
• se restablecen las restricciones de datos en segundo plano de sus aplicaciones.

No se perderá ningún dato de las aplicaciones. Esto no restablecerá las preferencias de las aplicaciones de otros usuarios.
